/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmPoster 
} from '@vime/core';

import { define } from '../lib';


define('vm-poster', VmPoster);


export interface PosterProps extends JSX.VmPoster, HTMLAttributes<HTMLVmPosterElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmPosterElement, PosterProps>(
  'vm-poster',
  new Set(['fit','isVideoView','currentPoster','mediaTitle','playbackStarted','currentTime']),
);
